function Carrucel() {
  return (
    <div className='carrucel-contenedor'>
      <CarrucelInformacion />
      <div className='carrucel'>
      {/* { 
        props.datos.categoria.map(dat=>{
          
          return(<Videos info={dat.categoria}/>)
         
        })
      } */}
      
    </div>
    </div>
    
  )
}

export default Carrucel
